The Story of Little Muck

=======

Magic, adventure, romance, witches, wizards and treasure.

An old man living in an oriental city tells the story of his life to a group of
unfriendly children. He too was once a young boy, by the name of Little Muck,
much like them, but with better manners and a heap of problems.

From the movie's release in 1953 to the fall of the GDR in East Germany,
Kleinen Muck remained the number one selling film of the Ministry of Foreign
Trade. It attracted 12,998,153 viewers in the country alone.

